import React from "react";
import "./ProjectCard.css"

export default function ProjectCard({title, image, caption, gitLink, webLink}) {
    return (
        <div className="card mx-auto text-center" style={{width: "18rem"}}>
            <img className="card-img-top" src={image} alt={`${title} logo`} />
            <div className="card-body">
                <h5 className="card-title">{title}</h5>
                <p style={{height: "18rem"}}>{caption}</p>
                <a className="card-button" href={gitLink}>View Code</a>
                <br />
                <a className="card-button" href={webLink}>View Project</a>
            </div>
        </div>
    )
}
